package com.web.orbitERP.vo;

public class IcStmtSch {
	private String basicYear;
	private String compYear;
	public IcStmtSch() {
		super();
		// TODO Auto-generated constructor stub
	}
	public IcStmtSch(String basicYear, String compYear) {
		super();
		this.basicYear = basicYear;
		this.compYear = compYear;
	}
	public String getBasicYear() {
		return basicYear;
	}
	public void setBasicYear(String basicYear) {
		this.basicYear = basicYear;
	}
	public String getCompYear() {
		return compYear;
	}
	public void setCompYear(String compYear) {
		this.compYear = compYear;
	}
	
	
}
	
